class QGrowingTextEdit(QTextEdit):
    def __init__(self, parent_, *args, **kwargs):
        super(QGrowingTextEdit, self).__init__(*args, **kwargs)
        self.document().contentsChanged.connect(self.sizeChange)
        self.heightMin = 1
        self.heightMax = 100
        self.setMinimumHeight(self.document().size().height())
        self.parent_ = parent_

    def sizeChange(self):
        docHeight = self.document().size().height()
        if self.heightMin <= docHeight <= self.heightMax:
            self.setMinimumHeight(docHeight)

    def keyPressEvent(self, event):
        if event.key() == QtCore.Qt.Key_Return:
            super().focusOutEvent(QtGui.QFocusEvent(QtCore.QEvent.FocusOut))
            self.parent_.shortcut_enter.activated.emit()
        else:
            super().keyPressEvent(event)

